import React, {useState} from 'react';

const SessionList = () => {

    const [sessions, setSessions] = useState([
        {
            id: 223131,
            name: "Session 1",
            isPrivate: true
        },
        {
            id: 3231231,
            name: "Session 2",
            isPrivate: true
        },
        {
            id: 22331231,
            name: "Session 3",
            isPrivate: false
        }

    ]);

    return ( 
        <div>

        { sessions.map(session => (
        <li> {session.name} </li>
        )) }

        </div>

    );
}

export default SessionList;
